import React from 'react';
import '../../App.scss'
import '../header/Header.scss';
import logo from '../../assets/Logo/Logo-brainflix.svg';
import userIcon from '../../assets/Images/Mohan-muruge.jpg';
import search from '../../assets/Icons/SVG/Icon-search.svg'


function Header() {
  return (
    <nav className="nav-bar">
      <div className="nav-bar__logo-container"><a href="#"><img src={logo} alt="Brainflix logo" className="nav-bar__logo"/></a></div>
      <div className="nav-bar__input-container">
        <input type="text" className="nav-bar__input" placeholder={search}/>
      </div>
      <div className="nav-bar__account">
        <button className="nav-bar__upload-button">+ UPLOAD</button>
        <img src={userIcon} alt="User Icon" className="nav-bar__icon"/>
        <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Adipisci culpa animi dicta, iure harum eligendi maxime nihil mollitia sint iste, tempora in incidunt sapiente aperiam debitis rem dignissimos doloremque delectus?</p>
      </div>
    </nav>
  );
}


export default Header;
